import './App.css';
import Login from './components/Login';

function App() {
  return (
    <Router>
    <Switch>
      <Route exact path="/" component={Home} />
      <Route path="/login" component={<Login />} />
      <Route path="/contact" component={Contact} />
    </Switch>
  </Router>
  );
}

export default App;
